import React from "react";
import { useDispatch } from "react-redux";
import { dogsSortByWeight } from "../../redux/action-creators";

export const SortByWeight = ({setPages}) => {

    const dispatch = useDispatch();

   const handleSort = (e) => {
        dispatch(dogsSortByWeight(e.target.value));
        setPages(1);
    }

    return (
        <div>
            <select onChange = {handleSort}>
                    <option value = "all">BY WEIGHT</option>
                    <option value = "ascendingWeight">ASCENDING WEIGHT</option>
                    <option value = "descendingWeight">DESCENDING WEIGHT</option>
            </select>
        </div>
    )
}
